import FooPages from './pages/FooPages'
import BarPages from './pages/BarPages'
import VueRouter from 'vue-router'


const routes = [
  {
    path: '/foo',
    components: FooPages
  },
    {
    path: '/bar',
    components: BarPages
  },
]

const router = new VueRouter({ routes })

export default router
